import React, { Component } from 'react';



class Filter extends Component {

	render(){
		return(
	     	<div style={{backgroundColor:'white'}}>

	     		<div style={{padding:'16px'}}>
		     		<h6><strong>Filter 486 Items</strong></h6>
	     		</div>

	     		<div style={{padding:'16px'}}>
	     			<h6>Color</h6>
	     		</div>

	     		<div style={{padding:'16px'}}>
	     			<h6>Size</h6>
	     		</div>

	     		<div style={{padding:'16px'}}>
	     			<h6>Price Range</h6>
	     		</div>

	     		<div style={{padding:'16px'}}>
	     			<h6>Brand</h6>
	     		</div>

	     		<div style={{padding:'16px'}}>
	     			<h6>Apply</h6>
	     		</div>

	     	</div>
		);
	}
}





export default Filter;
